column8:
このミシンがあれば、初めての刺しゅうもソーイングも思い通りに！<br>
USBメモリでらくらく操作！<br>
ミシンに付属の刺しゅう機をセットして、布を張った刺しゅう枠をセットすればあとは模様を選んで縫い始めるだけ！<br>
ワンポイント模様は56種類を内蔵。<br>アルファベット5書体、かな3書体内蔵しました。<br>
<br>

◆サイズ：幅550mm×奥行215mm×高さ278mm
<br>
◆重量：7.5kg
<br>
◆主な機能：スーパー糸通し、下糸クイック、簡単下糸巻き、7枚送り歯、自動止めぬい、自動糸切り、白色LEDライト、ティーチング機能
、エラーメッセージ、お好み調節<br>
◆アクセサリ：セミワイドテーブル（※刺しゅう機フタ兼用）、アクセサリーボックス（※小物を収納します）、ハードケース（※電源コードクリップ付き）、ボビンクリップ（4個）（※ボビン収納に便利）、使いこなしDVD（※つくりかたレシピ付き）、その他<br><br>

※ミシンのお支払い方法は、販売価格に関わらず全て「クレジットカード」または「払い込み用紙による前払い」 あるいは「代金引換」のみとさせていただきます。
<br>
※画像とは色合いが異なる場合がございます。<br><br>

<ul>
<li>アフターケアは当社並びにメーカーが責任を持って対応いたします。</li><li>保証期間はご購入後3年間です。故障の場合には、当社が責任を持って対応させていただきます。保障期間後を含めた故障の際には、当社（0282-67-2121）にご連絡ください。</li>
</ul>
<p>※メーカー希望小売価格はメーカーサイトに基づいて掲載しています</p><br><br>
※カタログ希望小売価格の表記は消費税５％時の価格です。現在は消費税８％の価格になります。<br><br>
