「モナミ ヌゥ アルファ」はやさしい使い心地で充実機能も満載。<br>
豊富なぬい模様にひらがななどの文字ぬいをプラス。260種類の縫いパターンを内蔵いたしました。<br>
さらに見やすい大型液晶画面や、自動糸切り機能も加わり、使い勝手が大幅にアップ。<br><br>
<ul>
<li>サイズ：幅439mm×奥行195mm×高さ287mm</li>
<li>重量：7.5kg</li>
<li>主な機能：バックライト付き液晶画面、手ぬい風キルトステッチ、自動糸調子、自動糸切り機能、全自動ボタンホール、ニュースレッディングシステム、自動針穴糸通し、模様ダイレクト選択ボタン、針上下ボタン、水平全回転ガマ、LED手元ランプ、ワイドなソーイングスペース、静音設計、止め縫い、7枚歯送り、ワンタッチスローボタン、下糸巻き自動停止、お知らせランプ、段縫い押えボタン、ドロップフィード</li>
<li>アクセサリ：ハードケース、アンダープレート付きボタンホール押え、使用説明DVD<br><br></li>

<li>※ミシンのお支払い方法は、販売価格に関わらず全て「クレジットカード」または「払い込み用紙による前払い」 あるいは「代金引換」のみとさせていただきます。</li>
<li>※画像とは色合いが異なる場合がございます。<br><br></li>

<li>保証期間はご購入後3年間です。故障の場合には、当社が責任を持って対応させていただきます。保障期間後を含めた故障の際には、当社（0282-67-2121）にご連絡ください。</ul>
<b>★このミシンに対応のフットコントローラーはこちら</b><br><br>
<b>★このミシンに対応のワイドテーブルこちら</b><br>
